import React from "react";
import './TopMain.css'
import { useNavigate } from "react-router-dom";

function TopMain(){
    const navigate = useNavigate();

    const enterClick = () => {
      navigate('/enter');
    };
    return (
        <header class='Top'>
            <button class='title' onClick={enterClink}>
                <h1 id='title'>Jump Up Happy School</h1>
            </button>
        </header>
    );
}

export default TopMain;
